class Solution {
    fun minimumBeautifulSubstrings(s: String): Int {
        val n = s.length
        val dp = IntArray(n + 1) { Int.MAX_VALUE / 2 }
        dp[0] = 0

        for (i in 1..n) {
            var value = 0L
            for (j in i downTo 1) {
                value = value shr 1 or ((s[j - 1] - '0') shl (i - j)).toLong()
                if (s[j - 1] == '1' && isPowerOfFive(value)) {
                    dp[i] = minOf(dp[i], dp[j - 1] + 1)
                }
            }
        }

        return if (dp[n] == Int.MAX_VALUE / 2) -1 else dp[n]
    }

    private fun isPowerOfFive(value: Long): Boolean {
        var num = value
        while (num > 0 && num % 5L == 0L) num /= 5
        return num == 1L
    }
}
